/**
 * @param {number[]} time
 * @param {number} totalTrips
 * @return {number}
 */
// BF模拟
var minimumTime = function (time, totalTrips) {
    let cnt = 0
    while (true) {
        cnt++
        let sum = 0
        for (const t of time) {
            sum += Math.floor(cnt / t)
        }
        if (sum >= totalTrips) {
            return cnt
        }
    }
};
// 随着时间的增加，sum也会增加，因此是个有顺序的列表，可以使用二分
var minimumTime = function (time, totalTrips) {
    const max = Math.max(...time)

    let l = 0
    let r = Math.ceil(totalTrips * max)
    while (l <= r) {
        const mid = l + Math.floor((r - l) / 2)
        if (calc(mid) >= totalTrips) {
            r = mid - 1
        } else {
            l = mid + 1
        }
    }
    return l

    function calc(cnt) {
        let sum = 0
        for (const t of time) {
            sum += Math.floor(cnt / t)
        }
        return sum
    }
}

